  return (
    <div>
      < script  src = " cleave.min.js " > </ script >
< script  src = " cleave-phone. {country} .js " > </ script >
      <Switch>
        <Route exact path="/">{SelectDate}</Route>
        <Route path='/payment'>{Payment}</Route>
      </Switch>
    </div>
  );
}

export default App;
